import axios from "axios";

const baseURL = "http://localhost:3030"

export async function pageLoadEvent() {
    const res = await axios.post(`${baseURL}/events`, {
        type: "Page load",
        timestamp: Date.now()
    })
    return res;
}

export async function adClickedEvent(e) {
    e.preventDefault();
    console.log("Clicked", e.target.getAttribute("data-google-query-id"))
    const res = await axios.post(`${baseURL}/events`, {
        type: "Ad clicked",
        timestamp: Date.now(),
        slot: e.target.id,
        googleQueryId: e.target.getAttribute("data-google-query-id")
    })
    return res;
}
